(3970, 445, 'founded_company_description', 'Welcome to A D Daffodils Consignment\r\n\r\nWe have initially established our retail and wholesale service in London since 2014 and it has become one of the most cherished well-known services in Myanmar. \r\n\r\nHowever, our excitement, compassion and efforts doesn\'t stop there. Our kindliness and sympathy  is the basic commitment which pushes toward further assistance in England Burmese society.\r\n\r\nOur goal is to facilitate our clients parcels, goods, personal belongings as easy and smooth as possible to the final destination with a low price. \r\n\r\nMoreover, we quote different prices,  offer coupons and other discounts every time the freight leaves. Hence, then our service becomes one of the reliable and trustworthy services \r\n'),
